const https = require('https');
const fsLib = require("fs");



function getAllBooksList() {
    const fsLib = require("fs");
    const filePath = "./server_data/booklist.json"
    //const type = "utf8"
    const jsonBuffer = fsLib.readFileSync(filePath)
    // noinspection UnnecessaryLocalVariableJS,JSCheckFunctionSignatures
    const jsonObjArray = JSON.parse(jsonBuffer)
    return jsonObjArray
}

function updateBookList(booksList){
    const fsLib = require("fs");
    const filePath = "./server_data/booklist.json"
    fsLib.writeFileSync(filePath, JSON.stringify(booksList, null, 4))
}

function randomFunctions(){
    function getRandomTextAsync(onDataLoaded) {
        const url = 'https://baconipsum.com/api/?type=meat-and-filler&paras=200&format=text'
        let data = '';
        const respCallBack = (resp) => {

            resp.on('data', (chunk) => data += chunk)   // A chunk of data has been received.
            resp.on('end', () => onDataLoaded(data)) // The whole response has been received. Print out the result.
        }
        https.get(url, respCallBack).on("error", () => onDataLoaded(data))
    }

    function getRandomTextPromises() {
        const url = 'https://baconipsum.com/api/?type=meat-and-filler&paras=1&format=text'
        let request_call =
            new Promise(
                (resolve, reject) => {
                    https.get(
                        url,
                        response => {
                            let chunks_of_data = [];

                            response.on('data', (fragments) => chunks_of_data.push(fragments));
                            response.on(
                                'end',
                                () => {
                                    let response_body = Buffer.concat(chunks_of_data);
                                    resolve(response_body.toString());  // promise resolved on success
                                }
                            )
                            response.on('error', (error) => reject(error)) /* promise rejected on error */
                        }
                    )
                }
            );

        request_call.then(response => console.log(response + "\n hello")).catch(error => console.log(error))

    }

}


